import ValueBox from './ValueBox';
import React, {useState} from 'react';
import './ChannelControl.css';


export default function ChannelControl({props, setState}) {
  let [test, setTest] = useState(0);
  return (
    <div className="">
          <ValueBox name="Scale" unit="V" data={test} setData={setTest}/>
          <ValueBox name="Vertical" unit="V" data={test} setData={setTest}/>
    </div>
    )
}
